export default {
  data: function data() {
    return {
      value: "",
      timeValue: "",
      list_input: {
        value: "",
        search: "",
        pages: 1,
        page: 1,
        page_size: 10,
        total: 100,
        filter: {},
        field: 'loginTime,desc'
      },
      tableData: []
    };
  },
  mounted: function mounted() {
    this.ReLoad();
  },
  methods: {
    sort_change: function sort_change(column) {
      console.log(column);

      if (column.order == 'ascending') {
        this.list_input.field = column.prop + ',asc';
        this.ReLoad();
      }

      if (column.order == 'descending') {
        this.list_input.field = column.prop + ',desc';
        this.ReLoad();
      }

      if (column.order == null) {
        this.list_input.field = '';
        this.ReLoad();
      }
    },
    search: function search() {
      this.list_input.page = 1;
      this.ReLoad();
    },
    ReLoad: function ReLoad() {
      var _this = this;

      // this.axios.post('/guanqu/ext-web/authenticate',{username:'admin',password:'admin'}).then((res) => {
      // });
      //获取列表
      this.axios.get('/guanqu/web/online-web-user/page', {
        params: {
          page: this.list_input.page - 1,
          size: this.list_input.page_size,
          name: this.value,
          sort: this.list_input.field
        }
      }).then(function (res) {
        _this.tableData = res.data.list;
        _this.list_input.total = res.data.totalCount;

        _this.tableData.forEach(function (item) {
          var date = new Date(item.loginTime);
          var year = date.getFullYear();
          var mon = date.getMonth() + 1;

          if (mon < 10) {
            mon = "0".concat(mon);
          }

          var day = date.getDate();

          if (day < 10) {
            day = "0".concat(day);
          }

          var hours = date.getHours();

          if (hours < 10) {
            hours = "0".concat(hours);
          }

          var minutes = date.getMinutes();

          if (minutes < 10) {
            minutes = "0".concat(minutes);
          }

          var seconds = date.getSeconds();

          if (seconds < 10) {
            seconds = "0".concat(seconds);
          }

          item.loginTime = "".concat(year, "-").concat(mon, "-").concat(day, " ").concat(hours, ":").concat(minutes, ":").concat(seconds);
        });
      });
    },
    //分页方法
    handleSizeChange: function handleSizeChange(val) {
      console.log(val);
      this.list_input.page = 1;
      this.list_input.page_size = val;
      this.ReLoad();
    },
    indexMethod: function indexMethod(index) {
      return index + 1 + this.list_input.page_size * (this.list_input.page - 1);
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.list_input.page = val;
      this.ReLoad();
    }
  },
  computed: {},
  components: {// YSH,
    // NYYSDY,
    // GYYSDY
  }
};
